import Axios from "axios";
import {useState, useEffect } from 'react'

function App() {
  const [data, setData] = useState(null);

  useEffect(()=>{
    Axios('http://localhost:5000//api')
      .then((res) => {
        console.log(res)
        setData(res)
      })
  })

  return (
    data == null ? (
      <div className="App">
        no data 
      </div>
    ) : (
      <div className="App">
        test
    </div>
    )
  );
}

export default App;
